import "./App.css";
import Header from "./Components/Header";
import MyList from "./Pages/MyList";
import CreateList from "./Pages/CreateList";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
    return (
        <BrowserRouter>
            <div className="App">
                Hello World!
                <Header />
                <Routes>
                    <Route path="/mylist" element={<MyList />} /> <Route path="/createlist" element={<CreateList />} />
                </Routes>
            </div>
        </BrowserRouter>
    );
}

export default App;
